import React, { Component } from 'react';
import './style.css';

class Country extends Component {
    render() {
        return (
            <div className="warranty__country">
            <p>COUNTRY</p>
            <label>
            <input type="radio"  name="country" value="USA" checked/>

            </label>
        </div>
        );
    }
}

export default Country;
